             {/*  Footer  */}

    <footer class="mt-5">
        <div class="footer_style text-white text-center container-fluid">
            <h6 class="text-center"> <i class="fa fa-copyright fa-1.5x text-black"></i> 2022 Bishal Nandi </h6>
        </div>
    </footer>
    </div>
  )
}

